function init(){console.log("init");document.querySelector("#grid");let e=document.querySelector("#card");window.stewards.forEach((t=>{let r=document.importNode(e.content,!0);tally_url="https://www.withtally.com/voter/"+t.address+"/governance/gitcoin",statement_url="https://gov.gitcoin.co/t/introducing-stewards-governance/41/"+t.statement_post_id,r.querySelector("#name").innerHTML=t.name,r.querySelector("#image").src="assets/stewards/"+t.image,r.querySelector("#handle_gitcoin").innerHTML=t.handle_gitcoin,r.querySelector("#handle_gitcoin").href="https://gitcoin.co/"+t.handle_gitcoin,r.querySelector("#steward_since").innerHTML=t.steward_since,r.querySelector("#workstream_url").href="TBD",r.querySelector("#votingweight").innerHTML=t.votingweight,r.querySelector("#participation_snapshot").innerHTML=t.participation_snapshot,r.querySelector("#participation_tally").innerHTML=t.participation_tally,r.querySelector("#delegate_button").href=tally_url,r.querySelector("#votingweight_url").href=tally_url,r.querySelector("#forum_post").innerHTML=t.posts,r.querySelector("#forum_uri").href="https://gov.gitcoin.co/u/"+t.handle_forum,r.querySelector("#statement_button").href=statement_url,r.querySelector("#steward_since_url").href=statement_url,r.querySelector("#health").src="assets/images/health_"+t.health+".svg",t.workstream?(stream=window.workstreams.find((e=>e.id===t.workstream)),r.querySelector("#workstream_name").innerHTML=stream.name,r.querySelector("#workstream_url").href=stream.uri):r.querySelector("#workstream_none").innerHTML="-",document.querySelector("#grid").appendChild(r)}))}window.addEventListener("load",(e=>{window.stewards=[],window.workstreams=[],Promise.all([fetch("assets/json/workstreams.json").then((e=>e.json())),fetch("assets/json/data.json").then((e=>e.json()))]).then((e=>{window.workstreams=e[0],window.stewards=e[1],init()})).catch((e=>{console.log(e)}))}));